import React from "react";
import {Link} from 'react-router-dom'
import '../Home/Home.css'
import Login from "../Login/Login";



export default function Home({modal}) {
    return (
        <>
            <h1>Home page</h1>
            <Link to='/register'>Register</Link>
            <Link to='/login'>Login</Link>
            
            <Login state={modal}/>
        </>
    )
}
